import React from 'react';
import classes from "./Header.module.css";
import OneLvlHeader from "./one_lvl/oneLvlHeader";

const Header = () => {
    return (
        <header className={classes.header}>
            {/*{<!-- 1 level -->}*/}
            <OneLvlHeader/>

            {/*{<!-- 2 level -->}*/}


            {/*{  <!-- 3 level -->}*/}
            <div className="nav_three_lvl">
                <div className="text_catalog">
                    <a href="src/components/header/Header#" className="item_catalog">Настольные игры</a>
                    <a href="src/components/header/Header#" className="item_catalog">Игрушки</a>
                    <a href="src/components/header/Header#" className="item_catalog">Хобби и творчество</a>
                    <a href="src/components/header/Header#" className="item_catalog">Книги и комиксы</a>
                    <a href="src/components/header/Header#" className="item_catalog">Дом и аксессуары</a>
                    <a href="src/components/header/Header#" className="item_catalog">Подарки</a>
                    <a href="src/components/header/Header#" className="item_catalog">Новинки</a>
                    <a href="src/components/header/Header#" className="item_catalog">Лидеры продаж</a>
                </div>
            </div>
        </header>
    );
};

export default Header;
